import React from "react";
export default function ShowWeather({weatherData}) {
    if (Object.keys(weatherData).length === 0) {
        return (
            <div className="showWeather">
            <div id="loading-weather-data">Loading</div>
            </div>
        )
    }
    const {city} = weatherData?.name || null;
    const {temp, pressure, humidity} = weatherData.main || null;
    const cloudCoverage = weatherData?.clouds?.all || null;
    const {visibility} = weatherData;

    return (
        <section className="showWeather">
            <h2 className="weather_heading">Weather Data for {city}</h2>
            <h3 className="temp">Temperature in Farenheit: {temp} degrees</h3>
            <div className="general_weather_data">
                <p id="pressure">Pressure: {pressure} atm</p>
                <p>Visiblity: {visibility} km</p>
                <p>Humidity: {humidity} % </p>
                <p>Pressure: {cloudCoverage} % </p>
            </div>
        </section>



    )

}
